import React from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';
import { Header } from './components/pages/Header.component'

function App() {
  return (
    <>
        <div className="navbar-bg">
          <Navbar className="navBar" />
        </div>
        <Header />
    </>
  );
}

export default App;
